import React from 'react';

class VideoListItem extends React.Component{
    render(){
        return(
            <div>
                <div className="videolist-item">
                <img  src={this.props.videos.snippet.thumbnails.medium.url} alt="thumb"/>
                <div className="videolist-item__desc">
                    <h4>{this.props.videos.snippet.channelTitle}</h4>
                    <p>{this.props.videos.snippet.title}</p>
                </div>
                </div>
            </div>
        )
    }
}

export default VideoListItem;
